pragma solidity ^0.8.0;

contract FeeManager {
    address public owner;
    uint256 public sellFee;
    uint256 public buyFee;
    uint256 public transferFee;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Ownable: caller is not the owner");
        _;
    }

    function updateSellFees(uint256 _sellFee, uint256 _buyFee, uint256 _transferFee) public onlyOwner {
        require(_sellFee <= _buyFee + _transferFee, "Invalid fee configuration");

        sellFee = _sellFee;
        buyFee = _buyFee;
        transferFee = _transferFee;
    }
}

